  return (
    <>
      <div style={bigTitleStyle}>
        <h1>About BIG</h1>
        <p>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Praesent cursus, enim vitae bibendum fringilla, neque nisl volutpat nulla, eget sagittis risus magna a felis. Sed eget neque ornare, ornare sem ut, tempor leo. Pellentesque varius pulvinar egestas. Nulla id lectus vel eros accumsan molestie at sed diam. Suspendisse interdum magna a porttitor sagittis. Mauris ut sodales mi. Phasellus cursus elit eget magna posuere, nec ultricies felis ornare. Aenean porta leo laoreet, commodo tortor id, cursus lacus. Aliquam non volutpat lorem. Morbi vestibulum erat nibh, sed gravida leo venenatis ut. Nullam varius diam justo, at iaculis purus facilisis quis. Curabitur suscipit scelerisque metus ac suscipit. Quisque ut ex diam.

In libero mi, bibendum vel feugiat at, eleifend eget ante. Quisque id pretium dolor. Morbi aliquet ultricies erat a rutrum. In pellentesque fringilla arcu eu pharetra. Nulla sed odio eleifend, efficitur velit quis, rutrum arcu. Suspendisse at ultricies arcu. Maecenas gravida tortor eu magna placerat, at auctor diam tristique. Quisque venenatis feugiat nisl id fermentum. Integer et tempor felis. Nam ut varius ex. Duis non porttitor ante. Nam sed fringilla mauris, nec tincidunt sem. Sed ultricies nunc id sapien ultricies porta. Sed volutpat libero non velit tempor, pretium fermentum mi blandit. Sed lobortis auctor varius. Nulla sed odio dui.

In ut dolor vitae risus posuere elementum. Suspendisse potenti. Aliquam fringilla nunc vel orci egestas tempor. Aliquam eget porta diam. Morbi at ante rutrum, accumsan ligula vitae, volutpat diam. Nulla interdum quam aliquet augue interdum volutpat. Donec pellentesque, magna semper consectetur posuere, enim erat suscipit ligula, sit amet luctus lacus dolor vitae lectus. Etiam lectus purus, aliquet ac arcu eu, maximus vestibulum felis.
        </p>
      </div>
    </>
    
  )
}

export default AboutUs
